import React from 'react';
import { Link } from 'react-router-dom';

const Contacts = () => {
    return (
        <div>
            Contact Page
            <Link to={'/display'}>
                <button>Display Connects </button>
            </Link>
            <Link to={'/CreateConnect'}>
                <button>Create Connects </button>
            </Link>
        </div>
    );
}

export default Contacts;
